import React from 'react';
import './App.css';

function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul>
            <li className="nav-links">About</li>
            <li className="nav-links">Shop</li>
        </ul>
    </nav>
  );
}

export default Nav;
